import calculate
import unittest

class TestCalculate(unittest.TestCase):

    def test_judge_leap_year(self):
        # Test that leap year returns True
        result = calculate.judge_leap_year(2000)
        self.assertTrue(result)

        # Test that non-leap year returns False
        result = calculate.judge_leap_year(2001)
        self.assertFalse(result)

        # Test that leap year with century not multiple of 400 returns False
        result = calculate.judge_leap_year(1900)
        self.assertFalse(result)

